import React from "react";
import { map } from "lodash";

export default function BtnNavigation(props) {
  const { data } = props;

  return (
    <>
      <div className="slider-navigation">
        <div className="options">
          {map(data, (btn, index) => (
            <div className="nav-btn"></div>
          ))}
        </div>
      </div>
    </>
  );
}
